import styled from "styled-components";

export const AppBarHeader = styled.header`
  position: sticky;
  width: 100%;
  height: 70px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px;
  border: 1px solid #e6e6e6;
`;

export const AppBarLogoContainer = styled.div`
  width: 45px;
  height: 45px;

  img {
    width: 100%;
  }
`;

export const AppBarAvatar = styled.img`
    width: 45px;
    height: 45px;
    border-radius: 50px;`
